const Header = () => {
  return (
    <section className="header">
      <div className="container">
        <div className="row">
          <div className="col-md-3">
            <img src="./img/logo_black.png" alt="" />
          </div>
          <div className="col-md-9"></div>
        </div>
      </div>
    </section>
  );
};

export default Header;
